import React, { useState } from 'react';
import styled from 'styled-components';

const MainTable = styled.table`
  border-collapse: collapse;
  width: 100%;
  margin-bottom: 20px;

  th, td {
    border: 1px solid #ddd;
    padding: 8px;
    text-align: left;
  }

  .inventory-row {
    background-color: #f2f2f2;
  }

  table {
    width: 100%;
    border-collapse: collapse;
  }

  table th, table td {
    border: 1px solid #ddd;
    padding: 8px;
  }

  table th {
    background-color: #f2f2f2;
  }

  tr:hover {
    background-color: #f5f5f5;
  }

  table table tr:hover {
    background-color: #e2e2e2;
  }
`;

const SiteInventoryItem = ({ data }) => {
    const [expandedSites, setExpandedSites] = useState([]);

    const handleSiteClick = (siteCode) => {
        setExpandedSites(prev =>
            prev.includes(siteCode) ? prev.filter(code => code !== siteCode) : [...prev, siteCode]
        );
    };

    // Lọc danh sách các site duy nhất dựa trên site_code
    const uniqueSites = data.reduce((unique, item) => {
        return unique.some(i => i.site.site_code === item.site.site_code) ? unique : [...unique, item];
    }, []);

    return (
        <MainTable>
            <thead>
                <tr>
                    <th>Site Code</th>
                    <th>Site Name</th>
                    <th>By Ship</th>
                    <th>By Air</th>
                    <th>Other Info</th>
                </tr>
            </thead>
            <tbody>
                {uniqueSites.map((item, index) => (
                    <React.Fragment key={index}>
                        <tr onClick={() => handleSiteClick(item.site.site_code)}>
                            <td>{item.site.site_code}</td>
                            <td>{item.site.siteName}</td>
                            <td>{item.site.byShip}</td>
                            <td>{item.site.byAir}</td>
                            <td>{item.site.otherInfo}</td>
                        </tr>
                        {expandedSites.includes(item.site.site_code) &&
                            data
                                .filter(inventoryItem => inventoryItem.site.site_code === item.site.site_code)
                                .map((inventoryItem, invIndex) => (
                                    <tr key={`${index}-${invIndex}`} className="inventory-row">
                                        <td colSpan="5">
                                            <table>
                                                <thead>
                                                    <tr>
                                                        <th>Inventory ID</th>
                                                        <th>Merchandise Code</th>
                                                        <th>In Stock Quantity</th>
                                                        <th>Unit</th>
                                                    </tr>
                                                </thead>
                                                <tbody>
                                                    <tr>
                                                        <td>{inventoryItem.inventory.inventory_id}</td>
                                                        <td>{inventoryItem.inventory.merchandiseCode}</td>
                                                        <td>{inventoryItem.inventory.inStockQuantity}</td>
                                                        <td>{inventoryItem.inventory.unit}</td>
                                                    </tr>
                                                </tbody>
                                            </table>
                                        </td>
                                    </tr>
                                ))
                        }
                    </React.Fragment>
                ))}
            </tbody>
        </MainTable>
    );
};

export default SiteInventoryItem;
